import React from 'react';
import Column from './Column';

const Board = () => {
    const columns = [
        { title: 'No priority', cards: [/* list of cards */] },
        { title: 'Urgent', cards: [/* list of cards */] },
        { title: 'High', cards: [/* list of cards */] },
        { title: 'Medium', cards: [/* list of cards */] },
        { title: 'Low', cards: [/* list of cards */] }
    ];

    return (
        <div className="board">
            {columns.map((column, index) => (
                <Column key={index} title={column.title} cards={column.cards} />
            ))}
        </div>
    );
};

export default Board;
